TextEquiv.Unicode:
Que te quiero bien lo sabes
aunque voy disimulando;
siento mucho tus pesares;
la palabra que te he dado,
solo te encargo que guardes,
Mucho mi amor te venera,..
no tengas triste que estar;
yo te adoro en gran manera,;
mas no te puedo esplicar...
el secreto hasta que quiera..

 Cuanto mas firmete quiero;
Mú aborreciéndome vas;
yá que asieme has olvidadoja
tcomo pagasicobrarás.
